    /*custom*/
    html body .navigation-bar {
        background-color: var(--bg-body);
    }

    html body .note-title__input {
        color: var(--N900);
    }

    .navigation-bar.navigation-bar__suite .navigation-bar__left path,
    .navigation-bar button svg path:last-child,
    .navigation-bar .btn svg path:last-child {
        fill: var(--N800);
    }

    .navigation-bar .new-notice-icon svg path:last-child {
        fill: none;
        stroke: var(--N800);
    }

    .suite-body {
        background-image: none !important;
        background-color: var(--bg-body) !important;
    }

    #outerdocbody .maindocbody, .print .maindocbody {
        color: var(--text-title) !important;
    }

    body .doc-history-revert__content > div:first-child :not(a) > span,
    body .maindocbody > div:first-child :not(a) > span,
    body .print .maindocbody > div:first-child :not(a) > span {
        color: var(--text-title) !important;
    }

    .section-nav-container .full-entry-title {
        background-color: transparent;
        color: var(--text-caption);
    }

    .section-nav-container .section-nav .pin {
        background-color: transparent;
    }

    .section-nav-container .section-nav .pin svg path:last-child {
        fill: var(--text-caption);
    }

    .section-nav-container .section-nav.showing-full .entries-container {
        background-color: transparent !important;
    }

    .innerdocbody .inline-code {
        background-color: var(--N100) !important;
        border-color: var(--N300);
    }

    .zoneType-codeBlock .code-block {
        background-color: var(--N100);
    }

    .zoneType-codeBlock .code-block-header {
        background-color: var(--N200);
    }

    .zoneType-codeBlock .code-block-header-btn {
        color: var(--N900);
    }

    html, html body, #mainBox, body #ssrBox .app-main-container:not(.is-suite) {
        background-color: var(--bg-body) !important;
        color: var(--text-title);
    }

