@-moz-document regexp('https://.+\.feishu\.cn/drive/home.+') {

    body {
        --wwl-bg-input: hsl(0, 0%, 90%);
        --bg-float: var(--bg-base);
        --primary-pri-500: var(--text-caption);
        --text-caption: var(--text-caption);
        color: var(--text-title);
    }

    .navigation-bar__search-note.explorer .search-box, .navigation-bar__search-note.relationGraph .search-box,
    input,
    .lightweight-search-input__inner-input{
        background: var(--wwl-bg-input);
    }

    .advanced-search-recent-tab-list .advanced-search-recent-tab-item.selected {
        background-color: var(--wwl-bg-input);
    }

    .router-link {
        color: var(--text-title);
    }

    .explorer__button.blue {
        background-color: transparent;
        border-color: var(--text-title);
        color: var(--text-title);
    }

    .navigation-bar__search-note .item__title {
        color: var(--text-title);
    }

    .search-list__sticky_bar, .search-list__bottom_bar {
        background-color: var(--bg-base);
    }

    .search-list__sticky_bar div {
        color: var(--text-title) !important;
    }

    .advanced-search__content {
        background-color: var(--bg-base);
    }

    .advanced-search-recent-tab-list .advanced-search-recent-tab-item,
    .advanced-search-tab-list .advanced-search-tab-list__item,
    .search-filter-title__main{
        color: var(--text-title);
    }
    .advanced-search-base-checkbox-filter__list .advanced-search-base-checkbox-filter__list-item-label span {
        color: var(--text-title)
    }

    .advanced-search-tab-list .advanced-search-tab-list__item:hover,
    .advanced-search-recent-tab-list .advanced-search-recent-tab-item:hover {
        color: var(--B500);;
    }
    .advanced-search-wrapper .advanced-search {
        box-shadow: var(--shadow-md-down);
        border: 1px solid var(--line-border-card);
    }
    body #skeleton-sidebar,
    body .main-header,
    body .main-content {
        background-color: var(--bg-body) !important;
    }


}
